  <title>Menu Buff Tool + Nháº¡c</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-family: monospace;
    }

    body, html {
      height: 100%;
      overflow: hidden;
    }

    video#bg {
      position: fixed;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      object-fit: cover;
      z-index: -1;
    }

    canvas#spiderCanvas {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      z-index: -1;
    }

    .terminal {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      width: 90%;
      max-width: 600px;
      background: rgba(0, 0, 0, 0.7);
      padding: 20px;
      color: #0f0;
      font-size: 14px;
      border-radius: 10px;
    }

    .loading {
      color: #fff;
      font-size: 16px;
      margin-top: 10px;
      text-align: center;
    }

    .dpl-finished {
      color: #0ff;
      text-align: center;
      margin-top: 20px;
      font-weight: bold;
      display: none;
    }

    .music-toggle {
      position: fixed;
      bottom: 20px;
      right: 20px;
      z-index: 10;
    }

    .music-toggle button {
      padding: 10px 20px;
      font-size: 14px;
      background: #0f0;
      color: #000;
      border: none;
      border-radius: 8px;
      box-shadow: 0 0 10px #0f0;
      cursor: pointer;
    }

    function draw() {
      ctx.clearRect(0, 0, canvas.width, canvas.height);
      for (let i = 0; i < points.length; i++) {
        let p = points[i];
